		function centerWave(wave) {
        let sum = 0.0;
        for (let i = 0; i < wave.length; i++)
            sum += wave[i];
        const average = sum / wave.length;
        for (let i = 0; i < wave.length; i++)
            wave[i] -= average;
        performIntegral(wave);
        wave.push(0);
        return new Float64Array(wave);
    }
		function performIntegral(wave) {
      let cumulative = 0.0;
        for (let i = 0; i < wave.length; i++) {
            const temp = wave[i]; 
            wave[i] = cumulative;
            cumulative += temp;
        }
    }
